!function(){const t="<%= matchData ? matchData.tanggal : '' %>",e="<%= matchData ? matchData.waktu.replace('.', ':') : '' %>";const n=new Date(t),[a,o]=e.split(":").map(Number);n.setHours(a,o,0,0);const r=new Date(n.getTime()+54e5),c=document.getElementById("countdown");let i;function l(){const t=new Date;if(t>=r)return c.textContent="Pertandingan Sudah Selesai",void clearInterval(i);if(t>=n)return void(c.textContent="Pertandingan Sedang Dimulai");const e=n-t,a=Math.floor(e/36e5),o=Math.floor(e%36e5/6e4),l=Math.floor(e%6e4/1e3);c.textContent=`${a} jam ${o} menit ${l} detik`}try{l(),i=setInterval(l,1e3)}catch(t){console.error("Error dalam countdown:",t),c.textContent="Error menghitung waktu"}}();